window.updateBalances = function () {
  var company_code = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : "";
  loadOnAny(".number", false, {
    styles: {
      container: {
        minHeight: "32px",
        height: "auto"
      },
      loader: {
        width: "20px",
        height: "20px",
        borderWidth: "4px"
      }
    }
  });
  loadOnTable("#withdrawals-table-data", "#withdrawalsTable");
  var companyCode = company_code ? company_code : $('.company-navbar').val();
  $.ajax({
    url: "/api/finances/getbalances",
    type: "GET",
    data: {
      company: companyCode,
      gateway_id: gatewayCode
    },
    dataType: "json",
    headers: {
      Authorization: $('meta[name="access-token"]').attr("content"),
      Accept: "application/json"
    },
    error: function error(response) {
      loadOnAny(".number", true);
      errorAjaxResponse(response);
    },
    success: function success(response) {
      loadOnAny(".number", true);
      $(".removeSpan").remove();
      var $titleAvailableBalance = onlyNumbers(response.available_balance) > 0 ? "Saldo Disponível" : "Saldo Atual";
      $("#title_available_money").html($titleAvailableBalance);
      $(".available-balance").html(removeMoneyCurrency(response.available_balance));
      $(".available-balance-mobile").html(removeMoneyCurrency(response.available_balance));
      $(".pending-balance").html(removeMoneyCurrency(response.pending_balance));
      $(".total-balance").html(removeMoneyCurrency(response.total_balance));
      $(".blocked-balance").html(removeMoneyCurrency(response.blocked_balance));
      $(".debt-balance").html(removeMoneyCurrency(response.pending_debt_balance));

      if (onlyNumbers(response.pending_debt_balance) != "000") {
        $("#balance-resumes > .col-md-4").removeClass("col-md-4").addClass("col-md-3");
        $("#card-debt-balance").show();
      }

      $(".loading").remove();
      $("#div-available-money, #div-available-money_m").off("click");
      $("#div-available-money, #div-available-money_m").on("click", function () {
        if (response.available_balance.charAt(0) == "-" || onlyNumbers(response.available_balance) == "000") {
          return;
        }

        $("#custom-input-addon").val(removeMoneyCurrency(response.available_balance));
        $(".custom-input-addon-m").val(removeMoneyCurrency(response.available_balance));
      });
      loadWithdrawalsTable();
    }
  });
};

window.loadWithdrawalsTable = function () {
  var link = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : null;
  var statusWithdrawals = {
    1: "warning",
    2: "primary",
    3: "success",
    4: "danger",
    5: "primary",
    6: "primary",
    7: "danger",
    8: "primary",
    9: "partially-liquidating"
  };
  $("#withdrawals-table-data").html("");
  loadOnTable("#withdrawals-table-data", "#transfersTable");

  if (link == null) {
    link = "/api/withdrawals";
  } else {
    link = "/api/withdrawals" + link;
  }

  function getRequestTime() {
    var data = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : "";
    var request_date = "";
    if (!isEmpty(data.date_request)) request_date = "<div class=\"d-block d-md-none\"> Solicitado em  </div>\n                            <div class=\"bold-mobile\"> ".concat(data.date_request, " </div>");
    if (!isEmpty(data.date_request_time)) request_date += "<small style=\"color: #9E9E9E; font-size: 11px\"> \xE0s ".concat(data.date_request_time.replace(":", "h"), " </small>");
    return request_date;
  }

  function getReleaseTime() {
    var data = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : "";
    var release_date = "";
    if (!isEmpty(data.date_release)) release_date = "<div class=\"d-block d-md-none\"> Liberado em  </div>\n                            <div class=\"bold-mobile\"> ".concat(data.date_release, " </div>");
    if (!isEmpty(data.date_release_time)) release_date += "<small style=\"color: #9E9E9E; font-size: 11px\"> \xE0s ".concat(data.date_release_time.replace(":", "h"), " </small>");
    return release_date;
  }

  function removeFormatNumbers(number) {
    return number.replace(/,/g, "").replace(/\./g, "");
  }

  function formatMoney(value) {
    return (value / 100).toLocaleString("pt-BR", {
      style: "currency",
      currency: "BRL"
    }).replace(/\s+/g, "").replace("-", "- ");
  }

  $.ajax({
    method: "GET",
    url: link,
    data: {
      company_id: $('.company-navbar').val(),
      gateway_id: window.gatewayCode
    },
    dataType: "json",
    headers: {
      Authorization: $('meta[name="access-token"]').attr("content"),
      Accept: "application/json"
    },
    error: function error(response) {
      errorAjaxResponse(response);
    },
    success: function success(response) {
      $("#withdrawals-table-data").html("");

      if (response.data === "" || response.data === undefined || response.data.length === 0) {
        var emptyImage = $("#withdrawals-table-data").attr("img-empty");
        $("#withdrawals-table-data").html("<tr style='border-radius: 16px;'>\n                            <td colspan='6' class='text-center' style='vertical-align: middle;height:300px;'>\n                                <div class=\"row justify-content-center align-items-center h-p100 font-size-16\">\n                                    <img style=\"width: 124px;\" src='".concat(emptyImage, "' alt=\"\">Nenhum saque realizado at\xE9 o momento\n                                </div>\n                            </td>\n                        </tr>"));
        $("#withdrawals-pagination").html("");
      } else {
        $.each(response.data, function (index, data) {
          var tableData = "";
          var dateRequest = getRequestTime(data);
          var dateRelease = getReleaseTime(data);
          tableData += "<tr class=\"s-table table-finance-transfers\">;\n                                <td class=\"text-center sale-finance-transfers\" style=\"grid-area: sale\">#".concat(data.id, "</td>\";\n                                <td class=\"text-left truncate bank-finance-transfers\" style=\"grid-area: bank\">\n                                    <div style=\"color: #636363;\" class=\"truncate\"> ").concat(data.account_information_bank, " </div>\n                                    <small style=\"color: #9E9E9E; font-size: 11px;\"> ").concat(data.account_information, " </small>\n                                </td>;\n                                <td class=\"text-left date-start-finance-transfers\" style=\"grid-area: date-start\">\n                                    ").concat(dateRequest, "\n                                </td>;\n                                <td class=\"text-left date-end-finance-transfers\" style=\"grid-area: date-end\">\n                                    ").concat(dateRelease, "\n                                </td>;\n                                <td class=\"shipping-status text-center status-finance-transfers\" style=\"grid-area: status\">\n                                    <span class=\"badge badge-").concat(statusWithdrawals[data.status], " \"> ").concat(data.status_translated, " </span>\n                                </td>");

          if (data.tax_value > 0) {
            tableData += " <td class=\"text-left value-finance-transfers\" style=\"grid-area: value\">\n                                            <span class=\"font-md-size-20 bold\"> R$ </span>\n                                            <strong class=\"font-md-size-20\"> ".concat(data.value, " </strong> <br>\n                                            <small>(taxa de R$10,00)</small>");
          } else {
            tableData += " <td colspan=\"2\" class=\"text-left value-finance-transfers\" style=\"grid-area: value\">\n                                            <span class=\"font-md-size-20 bold\"> R$ </span>\n                                            <strong class=\"font-md-size-20\"> ".concat(data.value, " </strong>");
          }

          if (window.gatewayCode == "w7YL9jZD6gp4qmv" && data.debt_pending_value != null && data.debt_pending_value != "R$0,00") {
            tableData += "<br> <a role='button' class='pending_debit_withdrawal_id' withdrawal_id='".concat(data.id, "'><small style=\"color: #ED1C24;\">- ").concat(data.debt_pending_value, "</small></a>");
          }

          tableData += "</td>";

          if (window.gatewayCode == "w7YL9jZD6gp4qmv") {
            tableData += "</td><td class=\"d-none d-lg-table-cell\"><a role='button' class='details_transaction pointer' withdrawal='".concat(data.id, "'><span class='o-eye-1'></span></a></td></tr>");
          }

          tableData += "</tr>";
          $("#withdrawals-table-data").append(tableData);
          $("#withdrawalsTable").addClass("table-striped");
        });
        pagination(response, "withdrawals", loadWithdrawalsTable);
      }
    }
  });
};

