window.updateTransfersTable = function () {
  var link = arguments.length > 0 && arguments[0] !== undefined ? arguments[0] : null;
  $("#table-transfers-body").html("");
  loadOnTable("#table-transfers-body", "#transfersTable");

  if (link == null) {
    link = "/api/transfers";
  } else {
    link = "/api/transfers" + link;
  }

  var data = {
    company_id: $('.company-navbar').val(),
    gateway_id: window.gatewayCode,
    date_type: $("#date_type").val(),
    date_range: $("#date_range").val(),
    reason: $("#reason").val(),
    transaction: $("#transaction").val(),
    type: $("#type").val(),
    value: $("#transaction-value").val()
  };
  $.ajax({
    method: "GET",
    url: link,
    data: data,
    dataType: "json",
    headers: {
      Authorization: $('meta[name="access-token"]').attr("content"),
      Accept: "application/json"
    },
    error: function error(response) {
      errorAjaxResponse(response);
      $("#available-in-period").html("<span class=\"currency\">R$ </span>0,00");
    },
    success: function success(response) {
      $("#table-transfers-body").html("");
      var balance_in_period = response.meta.balance_in_period;
      var parseValue = parseFloat(balance_in_period.replace(".", "").replace(",", "."));
      var availableInPeriod = $("#available-in-period");
      availableInPeriod.html("<span ".concat(parseValue < 0 ? ' style="color:red;"' : "", "><span class=\"currency\">R$ </span>").concat(balance_in_period, "</span>"));

      if (parseValue < 0) {
        availableInPeriod.html("<span style=\"color:red;\"><span class=\"currency\">R$ </span>".concat(balance_in_period, "</span>")).parent().find(".grad-border").removeClass("green").addClass("red");
      } else if (parseValue > 0) {
        availableInPeriod.html("<span class=\"currency\">R$ </span>".concat(balance_in_period)).parent().find(".grad-border").removeClass("red").addClass("green");
      } else {
        availableInPeriod.html("<span class=\"currency\">R$ </span>0,00").parent().find(".grad-border").removeClass("red").addClass("green");
      }

      if (response.data == "") {
        $("#table-transfers-body").html("\n                    <tr class='text-center bg-transparent'>\n                        <td style='height: 300px; border-radius: 16px !important' colspan='11' >\n                            <div class=\"d-flex justify-content-center align-items-center h-p100\">\n                                <div class=\"row m-0 row justify-content-center align-items-center h-p100 font-size-16\">\n                                        <img style='width:124px; margin-right:12px;' alt=\"\"\n                                        src='".concat($("#table-transfers-body").attr("img-empty"), "'>\n                                    Nenhum dado encontrado\n                                </div>\n                            </div>\n                        </td>\n                    </tr>\n                "));
        $("#pagination-transfers").html("");
      } else {
        data = "";
        $.each(response.data, function (index, value) {
          data += '<tr class="s-table table-finance-schedule-new">';
          var dateRequest = getRequestTime(value);
          var dateRelease = getReleaseTime(value);

          if (value.is_owner && value.sale_id) {
            data += "<td style=\"grid-area: sale\" class=\"sale-finance-schedule text-center\">\n                            <span class=\"d-block mb-10\"> ".concat(value.reason, " </span>\n                            <a class=\"detalhes_venda pointer\" data-target=\"#modal_detalhes\" data-toggle=\"modal\" venda=\"").concat(value.sale_id, "\">\n                                <span class=\"transfers-sale\">#").concat(value.sale_id, "</span>\n                            </a>\n                        </td>");
          } else {
            if (value.reason === "Antecipação") {
              data += "<td style=\"grid-area: sale\" class=\"text-center sale-finance-schedule\">\n                                        <span class=\"d-block mb-10\"> ".concat(value.reason, " </span>\n                                        <span class=\"transfers-sale\"> #").concat(value.anticipation_id, " </span>\n                                    </td>");
            } else {
              data += "<td style=\"grid-area: sale\" class=\"text-center sale-finance-schedule\">\n                                        <span class=\"d-block mb-10\"> ".concat(value.reason, " </span>\n                                        ").concat(value.sale_id ? "<span class=\"transfers-sale\"> #".concat(value.sale_id, "</span>") : "", "\n                                    </td>");
            }
          }

          data += "<td class=\"date-start-finance-transfers text-left\" style=\"grid-area: date-start\"> ".concat(dateRequest, " </td>\n                             <td class=\"date-end-finance-transfers text-left\" style=\"grid-area: date-end\"> ").concat(dateRelease, " </td>");

          if (value.type_enum === 1) {
            data += "<td class=\"value-finance-schedule\" style=\"grid-area: value\">\n                                    <span class=\"font-md-size-20 bold\" style=\"color:green\"> R$ </span>\n                                    <strong class=\"font-md-size-20\" style=\"color:green\"> ".concat(value.value, " </strong>");

            if (value.reason === "Antecipação") {
              data += "<br><small style='color:#543333;'>(Taxa: ".concat(value.tax, ")</small> </td>");
            } else {
              data += "</td>";
            }
          } else {
            data += "<td class=\"value-finance-schedule\" style=\"grid-area: value\">\n                                    <span class=\"font-md-size-20 bold\" style=\"color:red\"> R$ </span>\n                                    <strong class=\"font-md-size-20\" style=\"color:red\"> ".concat(value.value, " </strong></td> ");
          }

          data += "</tr>";
        });
        $("#table-transfers-body").html(data);
        paginationTransfersTable(response);
      }
    }
  });

  function paginationTransfersTable(response) {
    $("#pagination-transfers").html("");
    var primeira_pagina = "<button id='primeira_pagina' class='btn nav-btn'>1</button>";
    $("#pagination-transfers").append(primeira_pagina);

    if (response.meta.current_page == "1") {
      $("#primeira_pagina").attr("disabled", true);
      $("#primeira_pagina").addClass("nav-btn");
      $("#primeira_pagina").addClass("active");
    }

    $("#primeira_pagina").unbind("click");
    $("#primeira_pagina").on("click", function () {
      updateTransfersTable("?page=1");
    });

    for (x = 3; x > 0; x--) {
      if (response.meta.current_page - x <= 1) {
        continue;
      }

      $("#pagination-transfers").append("<button id='pagina_" + (response.meta.current_page - x) + "' class='btn nav-btn'>" + (response.meta.current_page - x) + "</button>");
      $("#pagina_" + (response.meta.current_page - x)).on("click", function () {
        updateTransfersTable("?page=" + $(this).html());
      });
    }

    if (response.meta.current_page != 1 && response.meta.current_page != response.meta.last_page) {
      var pagina_atual = "<button id='pagina_atual' class='btn nav-btn active'>" + response.meta.current_page + "</button>";
      $("#pagination-transfers").append(pagina_atual);
      $("#pagina_atual").attr("disabled", true).addClass("nav-btn").addClass("active");
    }

    for (x = 1; x < 4; x++) {
      if (response.meta.current_page + x >= response.meta.last_page) {
        continue;
      }

      $("#pagination-transfers").append("<button id='pagina_" + (response.meta.current_page + x) + "' class='btn nav-btn'>" + (response.meta.current_page + x) + "</button>");
      $("#pagina_" + (response.meta.current_page + x)).on("click", function () {
        updateTransfersTable("?page=" + $(this).html());
      });
    }

    if (response.meta.last_page != "1") {
      var ultima_pagina = "<button id='ultima_pagina' class='btn nav-btn'>" + response.meta.last_page + "</button>";
      $("#pagination-transfers").append(ultima_pagina);

      if (response.meta.current_page == response.meta.last_page) {
        $("#ultima_pagina").attr("disabled", true);
        $("#ultima_pagina").addClass("nav-btn");
        $("#ultima_pagina").addClass("active");
      }

      $("#ultima_pagina").on("click", function () {
        updateTransfersTable("?page=" + response.meta.last_page);
      });
    }

    $("table").addClass("table-striped");
  }
};

